import React from "react";
import styled from "styled-components";

function Header() {
  return (
    <div>
      <Wrapper>
      <LogoWrapper>
       <img src="https://www.mirror.co/"></img>
      </LogoWrapper>
      </Wrapper>
    </div>
  );
}

export default Header;

const Wrapper = styled.a`
 
  url(data:image/svg+xml;base64,) left center no-repeat

`;
